import * as ReactDOM from 'react-dom';
import './index.css';
import {App2, AppViewType} from './App2';
import * as serviceWorker from './serviceWorker';
import * as React from 'react';
import { Application } from './components/dragAndDrop/Application';
import './icons/micon/css/micon.min.css';
import 'react-bootstrap-table-next/dist/react-bootstrap-table2.min.css';
import AppContext from './context/appContext/AppContext';

let viewType: number = 0;

const changeViewType = (viewType: number) => {
    viewType = viewType;
}


ReactDOM.render(
    <AppContext.Provider 
        value={{
            view: viewType,
            changeViewType: changeViewType
        }}
    >
        <App2 app={ new Application()}/>
    </AppContext.Provider>,

document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
